import React, { Component } from "react";
import "./SlickCard.css";
import Slider from "react-slick";

export default class CenterMode extends Component {
  render() {
    const settings = {
      customPaging: function (i) {
        return (
          <a>
            <img
              style={{ width: "100%", display: "block" }}
              src="https://picsum.photos/300"
              alt="img"
            />
          </a>
        );
      },
      dots: true,
      dotsClass: "slick-dots slick-thumb",
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
    };
    return (
      <div className="slickImage">
        <Slider {...settings}>
          <div>
            <img
              style={{ width: "100%" }}
              src="https://picsum.photos/300"
              alt="img"
            />
          </div>
          <div>
            <img
              style={{ width: "100%" }}
              src="https://picsum.photos/300"
              alt="img"
            />
          </div>
          <div>
            <img
              style={{ width: "100%" }}
              src="https://picsum.photos/300"
              alt="img"
            />
          </div>
          <div>
            <img
              style={{ width: "100%" }}
              src="https://picsum.photos/300"
              alt="img"
            />
          </div>
        </Slider>
      </div>
    );
  }
}
